import styled from "styled-components";
const DeleteThis = styled.span`
  color: #c6d2cf;
  float: right;
`;

const EditThis = styled.span`
  color: #c6d2cf;
  float: right;
`;
export const SingleTodo = () => {
  return (
    <Li key={key}>
      <span>{x}</span>
      <DeleteThis onClick={() => remove(x)}>Delete?</DeleteThis>
      <Edit changeHandler={Update} oldValue={x} />
    </Li>
  );
};
